El querer morirse o no existir es un pensamiento super dificil, ya sea para la persona o para los seres queridos..

SI HAS PENSADO ALGUNA VEZ ESTO O LO HAS HECHO
Te aconsejo que lo hables con alguna persona (amigo, papa, mama, abuelo, tio, etc.) O busca ayuda a algun profecional (psic√≥loga, psiquiatra, etc)
