Luego en la otra parte escribe TODAS las cosas malas que encuentras o las que no te gustan, y vee si realmente vale la pena, yo creo que no.
Habla de las cosas que no te gusta de alguien con esa persona, hablalo y resuelvelo y ya tendras un problema menos.
Piensa en las personas que realmente te aman, tu hermana, mama, papa, amiga/o (entre otros).

